description:
Join @benoftheweek  and @kelsiidaviess  in a paranormal investigation as they attempt to make contact with the other side in a creepy, haunted office building in LA. With help from creators @AmysCrypt , @samandcolby , and Shane and Ryan of @watcher , Ben and Kelsi deploy tried and true ghost hunting methods–from REM Pods to the Estes Method–in their attempt to make contact. Are they successful? Watch and find out. 

Thank you to the paranormal community for keeping us constantly scared and inspired. Read more about Ghost Hunting on YouTube here: https://blog.youtube/culture-and-trends/ghost-hunt/ 

